20li%E1%BB%87u%20Q9%2C%2C%2C%2C%2C%2C%2C%2C%2C%2C%0A%2C%2C90F2-3372%2C%2CKh%C3%B4ng%20c%C3%B3%20d%E1%BB%AF%20li%E1%BB%87u%20Q9%2C%2C%2C%2C%2C%2C%2C%2C%2C%2C%0A%2C%2C29B1-358.46%2C%2CKh%C3%B4ng%20c%C3%B3%20d%E1%BB%AF%20li%E1%BB%87u%20Q9%2C%2C%2C%2C%2C%2C%2C%2C%2C%2C%0A%2C%2C30F6-0369%2C%2CKh%C3%B4ng%20c%C3%B3%20d%E1%BB%AF%20li%E1%BB%87u%20Q9%2C%2C%2C%2C%2C%2C%2C%2C%2C%2C%0A")
            .then(res => res.text())
            .then(csv => {
                const rows = csv.split("\n").filter(row => row.trim() !== "");
                const headers = rows[0].split(",");
                const tableHead = document.getElementById("tableHead");
                const tableBody = document.getElementById("tableBody");

                let headerRow = "<tr>";
                headers.forEach(h => headerRow += `<th>${h}</th>`);
                headerRow += "</tr>";
                tableHead.innerHTML = headerRow;

                const allData = rows.slice(1).map(row => row.split(","));
                const displayData = data => {
                    tableBody.innerHTML = "";
                    data.slice(0, 50).forEach(row => {
                        let tr = "<tr>";
                        row.forEach(cell => {
                            const cellNorm = removeSpecial(cell);
                            const keyword = removeSpecial(document.getElementById("searchInput").value);
                            if (keyword && cellNorm.includes(keyword)) {
                                tr += `<td class='highlight'>${cell}</td>`;
                            } else {
                                tr += `<td>${cell}</td>`;
                            }
                        });
                        tr += "</tr>";
                        tableBody.innerHTML += tr;
                    });
                };

                document.getElementById("searchInput").addEventListener("input", () => {
                    const keyword = removeSpecial(document.getElementById("searchInput").value);
                    const filtered = allData.filter(row => row.some(cell => removeSpecial(cell).includes(keyword)));
                    displayData(filtered);
                });

                displayData(allData);
            });
    </script>
